    data: |
      SELECT ALL - col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NULL NOT BETWEEN CAST ( NULL AS INTEGER ) / + col1 + + col0 AND + col2 * 2;
  - name: tab1

outputs:
  - name: q10195.out
    data: |
